subSubSection.paragraph:
Male genitalia
: penis tubular, shorter than parameres, completely covered by a dorsal, translucid, membranous extension of the basal piece; slightly curved in lateral view, strongly bent at base close to articulation with basal piece (
Figs. 27–29
). Permanently everted internal sac drawn out into a long and broad, colorless or yellow flagellum tapering towards apex, the latter slightly trilobate (
Fig. 29
), the median lobe longer; edge of flagellum serrulate towards apex. Parameres about as long as basal piece, broad and spatulate in dorsal view, with marginal fringe of setae entirely enclosed in the cuticle (not represented in figure). Basal piece in dorsal view with sides slightly converging toward apex, ventrally largely membranous, dorsally sclerotized; with a narrow, elongate sclerotic area along midline. Two long, slender struts run along basal piece from penis articulation, almost reaching the base of basal piece (
Figs. 27–28
).
